Released: March 11, 2011

Michael is in big trouble. Brandi was kind enough to co-sign a car loan for him since he was her son's best buddy. Now he got fired from his job and he can't pay her back for the past 2 months. She is steaming mad! The worst part is, the angrier she gets, the more it actually turns Michael on. Not caring about the consequences, he kisses her. She is shocked, and tries to resist at first, but seriously, angry sex is sometimes the best isn't it?
